import collections

def findAnagrams(s, p):
    # res = []
    # p = sorted([i for i in p])
    # for i in range(len(s)-len(p)+1):
    #     matching = True
    #     stmp = sorted([k for k in s[i: i+len(p)]])
    #     # for j in range(len(p)):
    #     #     if p[j] != stmp[j]:
    #     #         matching = False
    #     #         break
    #     # if matching:
    #     #     res.append(i)
    #     if stmp == p:
    #         res.append(i)
    # return res

    scount, pcount = collections.defaultdict(int), collections.defaultdict(int)
    if not p or len(p) > len(s) or not s:
        return []
    res = []
    for i in p:
        pcount[i] += 1
    have, need = 0, len(pcount)
    for i in range(len(p) - 1):
        if s[i] in pcount:
            scount[s[i]] += 1
            if scount[s[i]] == pcount[s[i]]:
                have += 1
    l = 0
    for r in range(len(p) - 1, len(s)):
        if s[r] in pcount:
            scount[s[r]] += 1
            if scount[s[r]] == pcount[s[r]]:
                have += 1
        if have == need:
            res.append(l)
        if s[l] in pcount:
            scount[s[l]] -= 1
            if scount[s[l]] != pcount[s[l]]:
                have -= 1
        l += 1
    return res


